// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Main from './pages/main'; // Ensure this path is correct
import StandUp from './pages/standup';
import Live from './pages/live';
import Edu from './pages/cultural';
import Social from './pages/social';
import './App.css';

function App() {
  return (
    <Router>
      <div className='App'>
        <Routes>
          <Route path="/" element={<Main />} />
          <Route path="/sc" element={<StandUp/>} />
          <Route path="/lc" element={<Live/>} />
          <Route path="/ee" element={<Education/>} />
          <Route path="/sc" element={<Social/>} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
